import React from 'react';

function LoginFunc() {
    return (
        <section>
            <form>
            <h2>Login</h2>
            <p>Username</p>
            <p>Password</p>
            <button type='submit'>Submit</button>
            </form>
        </section>
    )
}

export default LoginFunc;
